import Select from "react-select";
import React, { Component } from "react";

class lista extends Component {

    render() {

        const { input, options } = props;

        return (
            <Select 
                {...input} 
                onChange={value => input.onChange(value)}
                options={options}
            />
            )
    }
}

export default lista
